import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import { withStyles, Grid, Typography, Container, Breadcrumbs, Link } from '@material-ui/core';
import styles from './style';
import axios from 'axios';
import { bannerMoeda } from '../../components/icons';
import Header from '../../components/header';
import Footer from '../../components/footer';
import ExchangeInput from '../../components/Input';

class Cambio extends Component {
  constructor(props) {
    super(props);
    this.state = {
      inputValue1: '',
      inputValue2: '',
      selecte1: 'EUR',
      selecte2: 'BRL',
      calculaValue: 0.0,
      calculaCosts: 0.0,
      valueTaxa: 0.0,
      exchangeRateEuroToBRL: 1.0,
      exchangeRateBRLToEuro: 1.0,
    };
  }

  render() {
    const { classes, t } = this.props;

    return (
      <>
        <Header />
        <div className={classes.bar}></div>

        <Grid container className={classes.banner1}>
          <Container>
            <Grid className={classes.banner}></Grid>
          </Container>
        </Grid>
        <Footer />
      </>
    );
  }
}

export default withRouter(withStyles(styles)(withTranslation()(Cambio)));
